def show_pandas_dataframe(df, n=10, **kwargs):
    style = '.dataframe td, .dataframe th {padding: 0.2em;}'
    print('%%html\n<style type="text/css">%s</style>\n%s' % (style, df.head(n).to_html(**kwargs)))
def head_to_pandas(sdf, n=10):
    return pd.DataFrame([row.asDict() for row in sdf.head(n)])
def show_spark_dataframe(sdf, n=10):
    show_pandas_dataframe(head_to_pandas(sdf, n=n))
def binned_column(col, buckets):
    buckets = np.array(buckets)
    return buckets[np.digitize(col, buckets)]
